import heroImage from "../../assets/home/mobile/image-hero-coffeepress.jpg"
import {HeroImageBox, 
    HeroBox, HeroImage,HeroTextBox} from "../Hero/Hero.styled"


export const Hero = () => {
    return (
     <HeroBox>
        <HeroImageBox>
        <HeroImage src={heroImage} alt="coffeepress"/>
        </HeroImageBox>
        <div>
            <h1>Great coffee made simple.</h1>
            <p>Start your mornings with the world’s best coffees. Try our expertly curated artisan 
            coffees from our best roasters delivered directly to your door, at your schedule.</p>
            <a href="#">Create your plan</a>
        </div>
     </HeroBox>
    );
  };
